import React  from 'react';
import './index.css';
import { useState } from 'react';

const App = () => {
    let curT = new Date().toLocaleTimeString(); 

    const[time,uptime] = useState(curT);

    const update =() =>{
        let tmp = new Date().toLocaleTimeString(); 
        console.log(tmp);
        uptime(tmp);
    }

    return(
        <>
            <h1>{time}</h1>
            <button onClick ={update}> GET TIME</button>
        </>
    );
};

export default App;
